import classes from "./ChatRightHeader.module.css";
import goBack from "../../images/goBack.png";
import share from "../../images/share.png";
import question from "../../images/question.png";

function ChatRightHeader() {
    return (
        <div className={classes.header}>
            <div className={classes.container}>
                <img src={goBack} className={classes.goBack} alt="返回" />
                <span className={classes.name}>平台預設</span>
                <img src={share} alt="分享" className={classes.share} />
                <img src={question} alt="更多資訊" />
            </div>
        </div>
    );
}

export default ChatRightHeader;
